import React from "react";
import { Center, Stack, Flex, useColorModeValue, Heading } from "@chakra-ui/react";

export default function Register(){
    return(
        <Center py={6}>
            <Stack
            borderWidth="1px"
            borderRadius="lg"
            w={{ sm: '100%', md: '540px' }}
            height={{ sm: '476px', md: '20rem' }}
            direction={{ base: 'column', md: 'row' }}
            bg={useColorModeValue('white', 'gray.900')}
            boxShadow={'2xl'}
            padding={4}>
                <Flex flex={1}>
                <Heading fontSize={'2xl'} fontFamily={'body'}>
                Regis User Account
                </Heading>

                </Flex>
            </Stack>
        </Center>
    )
}
